import './App.css';
import { useState } from 'react';

function App() {
  const [voltage, setVoltage] = useState('');
  const [current, setCurrent] = useState('');
  const [resistance, setResistance] = useState('');
  const [power, setPower] = useState(null);
  const [calculated, setCalculated] = useState({ v: '', i: '', r: '', p: '' });

  const calculate = (e) => {
    e.preventDefault();
    let v = parseFloat(voltage);
    let i = parseFloat(current);
    let r = parseFloat(resistance);
    let p = null;
    // Calculate missing variable if possible
    if (!isNaN(v) && !isNaN(i)) {
      r = v / i;
      p = (v * i) / 1000;
    } else if (!isNaN(v) && !isNaN(r)) {
      i = v / r;
      p = (v * i) / 1000;
    } else if (!isNaN(i) && !isNaN(r)) {
      v = i * r;
      p = (v * i) / 1000;
    } else {
      setCalculated({ v: '', i: '', r: '', p: '' });
      return;
    }
    setCalculated({
      v: v.toFixed(2),
      i: i.toFixed(2),
      r: r.toFixed(2),
      p: p.toFixed(3),
    });
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Power, Voltage, Current & Resistance Calculator</h1>
        <div style={{ margin: '1rem 0' }}>
          {/* Visual Diagram */}
          <svg width="320" height="180" style={{ background: '#222', borderRadius: 12, marginBottom: 16 }}>
            <rect x="20" y="60" width="80" height="60" rx="10" fill="#444" stroke="#888" strokeWidth="2" />
            <text x="60" y="95" fill="#fff" fontSize="18" textAnchor="middle">R</text>
            <text x="60" y="115" fill="#aaa" fontSize="12" textAnchor="middle">Resistor</text>
            <line x1="0" y1="90" x2="20" y2="90" stroke="#fff" strokeWidth="3" />
            <line x1="100" y1="90" x2="160" y2="90" stroke="#fff" strokeWidth="3" />
            <text x="10" y="80" fill="#fff" fontSize="14">V</text>
            <text x="110" y="80" fill="#fff" fontSize="14">I</text>
            <text x="160" y="90" fill="#fff" fontSize="14">→</text>
            <text x="160" y="110" fill="#fff" fontSize="12">Current</text>
          </svg>
          <div style={{ color: '#ccc', fontSize: 14, marginBottom: 8 }}>
            <div>Ohm's Law: <b>V = I × R</b></div>
            <div>Power: <b>P = V × I</b> (in Watts, kW = W / 1000)</div>
          </div>
        </div>
        <form onSubmit={calculate} style={{ display: 'flex', flexDirection: 'column', gap: '1rem', alignItems: 'center', minWidth: 260 }}>
          <div>
            <label>
              Voltage (V):
              <input
                type="number"
                value={voltage}
                onChange={e => setVoltage(e.target.value)}
                placeholder="Enter voltage or leave blank"
                style={{ marginLeft: '0.5rem' }}
                step="any"
              />
            </label>
          </div>
          <div>
            <label>
              Current (A):
              <input
                type="number"
                value={current}
                onChange={e => setCurrent(e.target.value)}
                placeholder="Enter current or leave blank"
                style={{ marginLeft: '0.5rem' }}
                step="any"
              />
            </label>
          </div>
          <div>
            <label>
              Resistance (Ω):
              <input
                type="number"
                value={resistance}
                onChange={e => setResistance(e.target.value)}
                placeholder="Enter resistance or leave blank"
                style={{ marginLeft: '0.5rem' }}
                step="any"
              />
            </label>
          </div>
          <div style={{ fontSize: 12, color: '#aaa', maxWidth: 320, textAlign: 'center' }}>
            Enter any two values to calculate the others.
          </div>
          <button type="submit">Calculate</button>
        </form>
        {calculated.p && (
          <div style={{ marginTop: '1.5rem', background: '#333', padding: 16, borderRadius: 8, minWidth: 220 }}>
            <h2 style={{ margin: 0, fontSize: 20 }}>Results</h2>
            <p style={{ margin: '0.5rem 0' }}>
              <b>Voltage (V):</b> {calculated.v}<br />
              <b>Current (A):</b> {calculated.i}<br />
              <b>Resistance (Ω):</b> {calculated.r}<br />
              <b>Power (kW):</b> {calculated.p}
            </p>
          </div>
        )}
      </header>
    </div>
  );
}

export default App;
